# Import testing module
import unittest
from unittest import mock

import project7

class Project7Test(unittest.TestCase):

    def compareArrays(self, lines, answer, method="Method name not provided"):
        ''' Helper method for comparing student's result (lines) to the correct result (answer).  '''
        
        # Check each individual line for an issue
        if(len(answer)==len(lines)):

            if(answer!=lines):
                counter=0
                areSame=True

                while(counter<len(answer) and areSame):
                    if(answer[counter]!=lines[counter]):
                        areSame=False
                        print()
                        print(str(method)+":  Line #"+str(counter)+" incorrect. " + lines[counter])
                    counter+=1

                result=areSame
            else:
                result=True
        else:
            result=False
            print("Not correct length of output")

        return result

